colors = ""

i = 1
char = 'B'
a_num = 0
b_num = 0
while 0 < i < len(colors)-1:
    if colors[i-1] == colors[i] == colors[i+1]:
        char = colors[i]
        if char == 'A':
            a_num += 1
        else:
            b_num += 1

    i += 1
print(a_num, b_num)

if a_num > 0 and b_num > 0:     # it works without this if block
    if a_num > b_num:           # this one is required though hahaa
        print(True)
    else:
        print(False)
